import FacebookIcon from "@material-ui/icons/Facebook";
import TwitterIcon from "@material-ui/icons/Twitter";
// @ts-ignore
import LinkedInIcon from "@material-ui/icons/LinkedInbook";
import GitHubIcon from "@material-ui/icons/GitHub";
import React from "react";


export default {
    name: "Ravin sir is coding",
    title: "Full stack developer",

    birthday:"30th november 1992",
    email:"ravinsharma@gmail.com",
    address:"Kasoli",
    phone:"123 456 7890",



    socials: {
        facebook: {
            link: "https://www.facebook.com",
            text: "RavinisCoding",
            icon: <FacebookIcon />

        },
        twitter: {
            link: "https://www.facebook.com",
            text: "MyTwitter",
            icon: <TwitterIcon />

        },
        Linkedin: {
            link: "https://www.facebook.com",
            text: "MyLinkedin",
            icon: <LinkedInIcon />

        },
        GitHub: {
            link: "https://www.facebook.com",
            text: "MyGithub",
            icon: <GitHubIcon />

        },
    },

}
